import React from 'react';
import styled from 'styled-components';

interface ItemProps {
  title: string;
}

export const CreateItem: React.FC<ItemProps> = ({ title }) => {
  return (
    <StyledContainer>
      {title}
    </StyledContainer>
  );
};

const StyledContainer = styled.div`
  margin: 5px;
  padding: 5px;
  width: 100px;
  height: 25px;
  max-width: 100px;
  font-size: 15px;
  border: 2px solid #3e3e3e;
  border-radius: 5px;
`;
